// shaders
SDEstimator.vertex_glsl = [
  "#version 300 es",
  "precision highp float;",
  "in vec2 aPos;",
  "in vec2 aUv;",
  "out vec2 vUv;",
  "void main() {",
    "gl_Position = vec4(aPos, 0., 1.);",
    "vUv = aUv;",
  "}"
].join("\n");

SDEstimator.fragment_glsl = [
  "#version 300 es",
  "precision highp float;",
  "uniform float uZ;",
  "uniform vec3 uMin, uMax, uDim;",
  "uniform mat3 uHiSqrt;",
  "uniform sampler2D uVertsTexture;",
  "uniform sampler2D uGammaTexture;",
  "in vec2 vUv;",
  "out vec4 fragColor;",

  "float Gamma(float h, float a) {",
    "return texture(uGammaTexture, vec2(a * 100. / 101. + .5 / 101.,",
                                       "h * 100. / 477. + .5 / 477.)).r;",
  "}",

  "void main() {",
    "float HiSqrtDet = determinant(uHiSqrt);",
    "// physical position of the grid point",
    "vec3 x;",
    "x.xy = (vUv * uDim.xy - vec2(.5, .5)) / (uDim.xy - vec2(1., 1.));",
    "x.xy = x.xy * (uMax.xy - uMin.xy) + uMin.xy;",
    "x.z = uZ;",

    "fragColor = vec4(Gamma(vUv.x * 4.76, vUv.y), 0., 0., 1.);",
  "}"
].join("\n");

SDEstimator.GetShader = function(gl, type, code) {
  var shader = gl.createShader(type);

  gl.shaderSource(shader, code);
  gl.compileShader(shader);

  if (gl.getShaderParameter(shader, gl.COMPILE_STATUS) === false) {
    console.error("Shader couldn\'t compile.");
  }

  if (gl.getShaderInfoLog(shader) !== "") {
    console.warn(type === gl.VERTEX_SHADER ? "Vertex:" : "Fragment:",
                 gl.getShaderInfoLog(shader));
  }

  return shader;
}

SDEstimator.program = SDEstimator.gl.createProgram();

SDEstimator.gl.attachShader(
    SDEstimator.program,
    SDEstimator.GetShader(
        SDEstimator.gl,
        SDEstimator.gl.VERTEX_SHADER,
        SDEstimator.vertex_glsl));

SDEstimator.gl.attachShader(
    SDEstimator.program,
    SDEstimator.GetShader(
        SDEstimator.gl,
        SDEstimator.gl.FRAGMENT_SHADER,
        SDEstimator.fragment_glsl));

SDEstimator.gl.linkProgram(SDEstimator.program);
